(60, 'Es el responsable operacional y contaco ITM para TlP?', 'CI y CERT', 'DSO y DSP', 'ICO y AIM', 'L-ITM y Proxy', 4),
(61, 'Son funciones de L-ITM', 'Plan de desarrollo, plan de plazos, calendarizar', 'Entrenamiento, proteccion de virus, administrar inventario', 'Mantenimiento, Construccion de maquinas, desarrollo de aplicaciones', 'configuracion de dispositivos de red y aplicar seguridad', 2),
(62, 'Son amenazas de las lineas de produccion', 'Retrasos en entregas, falta de disponibilidad, paro tecnico', 'Mala planeacion', 'Dispositivos de red inseguros, virus, sabotaje', 'Scrap, falta de material, fallas de maquinas', 3),
(63, 'Que es un Virus informatico?', 'Software que calcula la nomina de los empleados de una empresa', 'Software que altera el funcionamiento normal de la computadora, sin el permiso o el conocimiento del usuario', 'Software que ayuda a administrar el funcionamiento normal de una computadora', 'Software que elimina virus de la computadora', 2),
(64, 'Que debes hacer en caso de duda o sospecha de tener Virus en tu computadora industrial?', 'Contactar a L-ITM', 'Contactar a PRS', 'Contactar a DSP', 'Contactar a PT', 1),
(65, 'Como puedes infectar tu computadora con un virus informatico?', 'Compartiendo informacion con terceros', 'Abriendo correo electronico y paginas de internet maliciosas', 'Usando dispostivos USB sin previo escaneo de virus', 'Todas las anteriores', 4),
(66, 'Los siguientes son ejemplos de Virus', 'Aware, Slimware, Betterware', 'Tupperware, Alienware, Visionware', 'Ramsonware, Spyware, Malware', 'Software, Hardware, Firmware', 3),
(67, 'Son dificultades de las lineas de produccion', 'Dificultad para planear en caso de emergencia', 'Tiempo de vida mayor a 10 a&ntilde;os', 'Todas', 'Maquinaria obsoleta', 3),
(68, 'Es el responsable de Implementar la directiva central en planta Toluca?', 'L-ITM y Proxy', 'TlP/PM', 'DSO y DSP', 'CI y CERT', 2),
(69, 'Es el responsable de la operacion segura de los dispositivos IT en su area?', 'L-ITM y Proxy', 'DSO y DSP', 'CI  y CERT ', 'MSEx', 4),
(70, 'Es el comite directivo que desarrolla los estandares de seguridad en manufactura', 'SC-ITM', 'CERT', 'TEF', 'DSO', 1),
(71, 'Es el responsable de la recepcion y clasificacion de reportes de seguridad IT', 'DSO y DSP', 'CERT', 'SC-ITM', 'TlP/PM', 2),
(72, 'Como clasifica la directiva central ITM a los dispositivos de las areas de manufactura?', 'Vigentes u Obsoletos', 'Infectado o No infectado', 'Seguro o Inseguro', 'De acceso restingido o de acceso libre', 3),
