(74, 'Son medidas de la directiva central ITM', 'Segmentacion de la red, Inventario, Entrenamiento', 'Juntas con MSEx, CI y DSO', 'Aplicar 5s y 14 principios de calidad', 'Uso de EPP, ergonomia, maquinas seguras', 1),
(75, 'Son actividades contra Virus informaticos en produccion', 'Uso de programa Antivirus estandar Bosch', 'Escaneo continuo de maquinaria', 'Evitar uso de dispositivos USB en maquinaria', 'Todas', 4),
