(77, 'A quienes va dirigido el entrenamiento anual ITM?', 'DSP, DSO, ICO', 'Auditores de calidad, Ajustadores, eletromecanicos, etc.', 'Ing. de calidad, procesos,mantenimiento,etc.', 'Todas las anteriores', 4),
(78, 'Que es plan de emergencia ITM?', 'Documento dentro del cual encontramos procedimientos para saber que hacer en caso de un sismo', 'Documento dentro del cual encontramos procedimientos para saber como usar el EPP', 'Documento dentro del cual encontramos procedimientos para recuperar sistemas IT', 'Documento dentro del cual encontrarmos el OSHAS ', 3),
(79, 'A quienes va dirigido el plan de emergencia ITM?', 'MSE, QMM, EVR', 'CLP, CTG, ENG', 'ATMO, HSE, FCM', 'PLC, HDD, HMI', 1),
(80, 'Son riesgos para Bosch ante una incidencia al perder serguridad en la red?', 'Interrupcion en los procesos de negocio', 'Perdida de reputacion y ventaja competitiva', 'Perdida de informacion sensible', 'Todas', 4),
(81, 'Son documentos de manufactura Bosch sensibles:', 'Anuncios clasificados, publicaciones Web, Publicaciones en Pantallas ', 'Tripticos, Publicidad, Datos personales', 'Informes de produccion, Planes de ajuste, Diagramas y dibujos tecnicos. Etc.', 'Calendarios operativos, Articulos promocionales, Menu cafeteria', 3),
(82, 'Que dispositivos encontramos en la zona Segura (Verde)?', 'Programadores PG, Lap de servicio, Servidores de Lineas de manufactura', 'Programadores PG, Lap de servicio, Servidores de Lineas ', 'Dispositivos SCCM, Servidores de unidades de red, BCN', 'PLC, IPCs, Paneles', 2),
(83, 'Que dispositivos encontramos en la zona de Servicio (amarilla)?', 'Programadores PG, Lap de servicio, Servidores de Lineas de manufactura', 'Dispositivos SCCM, Servidores de unidades de red, BCN', 'Telefonos celulares, extensiones moviles, radios ', 'PLC, IPCs, Paneles', 1),
(84, 'Que dispositivos encontramos en la zona Insegura (Roja)?', 'Programadores PG, Lap de servicio, Servidores de Lineas ', 'Dispositivos SCCM, Servidores de unidades de red, BCN', 'Telefonos celulares, extensiones moviles, radios ', 'PLC, IPCs, Paneles', 4),
(85, 'Es uno de los objetivos del entrenamiento ITM?', 'Sensibilizar a los empleados sobre los riesgos dentro de las areas de manufactura', 'Ensea&ntildear al usuario a clasificar su informacion de acuerdo al ISP', 'Analizar fallas en las areas de manufactura', 'Ensea&ntildear los 14 principios de calidad', 1),
